import React from "react";
import styled from "styled-components";

const arr = [
  {
    title: `벤처인
회원가입`,
    img: "logo1.png",
  },
  {
    title: `사업계획서 및
재무제표 입력`,
    img: "logo2.svg",
  },
  {
    title: `서류접수 및
방문실사`,
    img: "logo3.svg",
  },
  {
    title: `벤처기업
인증서`,
    img: "logo4.svg",
  },
];
const Wrapper = styled.section`
  height: 1264px;
  background-color: #f8f8f8;
  & > div {
    width: 993px;
    height: 100%;
    margin: 0 auto;
  }
`;
function Bottom() {
  return (
    <Wrapper>
      <div>
        <div className="top">
          <div className="title">벤처인증은 어떻게 진행되나요?</div>
          <div className="sub">
            벤처확인 신청 및 결과 조회 등의 절차는 벤처인 웹사이트를 통해
            인터넷으로만 이루어집니다.
          </div>
          <div className="circle-wrapper">
            {arr.map(({ title, img }, idx) => {
              return <div key={idx} className="box"></div>;
            })}
          </div>
        </div>
        <div className="bottom"></div>
      </div>
    </Wrapper>
  );
}

export default Bottom;
